CREATE TEMP TABLE temp_walk_optimized (latitude DOUBLE PRECISION, longitude DOUBLE PRECISION, walk_score DOUBLE PRECISION);


-- Total rows: 3712

-- Update buildings
UPDATE buildings_full_merge_scanning AS b
SET 
    is_walk_optimized = TRUE,
    walk_score = w.walk_score
FROM temp_walk_optimized w
WHERE ST_DWithin(
    b.geom::geography,
    ST_SetSRID(ST_MakePoint(w.longitude, w.latitude), 4326)::geography,
    50
);

-- Verify
SELECT COUNT(*) FILTER (WHERE is_walk_optimized = TRUE) as walk_optimized
FROM buildings_full_merge_scanning;
